         y="11.5045"
         id="tspan48">købstadsjubilæet, hvor der blev opstillet to store </tspan><tspan

         y="23.009001"
         id="tspan50">kanoner. Det er afgrænset af græsvolde og en </tspan><tspan

         y="34.5135"
         id="tspan52">voldgrav, og der er adgang via to broer. Fra voldene </tspan><tspan

         y="46.018002"
         id="tspan54">er der udsigt over hav og strand, og rundt om </tspan><tspan
         x="0 5.2820001 11.0865 13.7275 22.173 27.977501 33.782001 39.063999 42.759499 45.6665 50.948502 54.644001 57.550999 63.355499 68.637497 72.333 75.239998 80.522003 86.3265 89.233498 91.874496 94.515503 97.156502 99.797501 105.0795 107.9865 113.791 119.073 122.7685 128.05051 130.6915 133.5985 140.4575 146.26199 152.0665 157.3485 163.153 168.9575 171.8645 175.56 179.25549 184.53751 187.4445 192.1945 197.4765 200.11749 205.39951 211.20399"

         x="-61.902 -59.261002 -56.354 -51.071999 -45.790001 -39.9855 -36.290001 -31.007999 -25.203501 -22.296499 -17.0145 -13.319 -10.412 -5.6620002 2.7835 8.5880003 13.338 19.1425 24.4245 28.120001 33.9245 36.831501 41.581501 46.863499 52.667999 57.417999 60.325001 62.966 65.607002 71.411499 77.216003 82.498001 86.193497 89.100502 94.904999 100.187 105.9915 108.8985 112.594 117.876 121.5715 125.267 130.549 136.3535 140.049 145.33099 149.0265 154.3085 160.11301 165.395"
         y="14.3355"
         id="tspan304">I kanten af Sæbygård Skov ligger den restaurerede </tspan><tspan

         y="25.84"
         id="tspan306">Jernkilde, som oprindeligt var et kursted pga. kildens </tspan><tspan
         x="-61.902 -56.0975 -50.815498 -48.1745 -42.369999 -38.6745 -33.392502 -27.587999 -22.306 -16.501499 -10.697 -5.415 -2.5079999 2.2420001 7.5240002 13.3285 19.132999 21.774 24.681 31.540001 36.821999 40.517502 43.4245 48.706501 52.402 55.308998 57.950001 60.856998 66.661499 71.943497 77.748001 80.654999 86.459503 91.209503 96.491501 100.187 105.9915 114.437 119.719 125.001 130.283 136.08749 141.36951"
         y="37.344501"
         id="tspan308">helbredende vand. Der er i dag overdækkede </tspan><tspan
         x="-61.902 -56.0975 -50.292999 -46.5975 -40.792999 -35.511002 -32.604 -26.7995 -20.995001 -18.087999 -12.2835 -3.8380001 1.9665 7.2484999 12.5305 15.4375 21.242001 27.046499 29.953501 35.757999 39.453499 45.257999 51.0625 56.867001 62.148998 65.056 70.860497 79.306 83.001503 88.283501 94.087997 99.370003 103.0655 105.9725 114.418 119.7 125.5045 128.4115 132.10699 135.80251 141.60699 145.30251 150.5845"
         y="48.848999"
         id="tspan310">borde og bænke og grønne områder med store </tspan><tspan
         x="-61.902 -56.0975 -52.402 -43.956501 -40.261002 -34.456501 -31.8155 -23.370001 -17.5655 -12.2835 -8.5880003 -5.6810002 0.1235 8.5690002 13.851 17.546499 20.1875 25.992001 31.796499 34.4375 37.344501 44.203499 49.4855 53.181 56.088001 61.369999 65.065498 67.972504 73.777 79.058998 84.863503 88.558998 93.841003 97.536499 100.4435 105.7255 109.421 112.328 118.1325 123.937 128.687 133.96899 136.61 142.41451 145.0555 147.96249 151.658 157.46249 165.908"

         x="0 3.6954999 8.9775 11.8845 15.58 19.275499 24.557501 30.362 33.002998 35.91 42.246498 44.887501 50.169498 53.865002 57.560501 60.467499 66.272003 72.0765 74.983498 78.679001 83.960999 89.765503 93.460999 96.367996 101.118 106.4 112.2045 118.009 120.65 123.557 132.0025 137.2845 143.089 148.371 152.0665 154.9735 160.778 166.5825 170.278 176.0825 181.3645 186.1145 191.3965 197.201 199.842 202.483 208.28751 211.983 214.62399"

         id="tspan68">få sten. Klart og rent vand, meget børnevenligt. </tspan><tspan

         y="23.009001"
         id="tspan70">Plads til lidt større armbevægelser og boldspil bag </tspan><tspan

         y="34.5135"

         y="0"
         id="tspan102">På Østfyn ligger den populære Elsehoved Strand. </tspan><tspan
         x="0 6.3365002 12.141 15.8365 18.7435 24.548 30.352501 33.259499 41.705002 47.509499 53.313999 56.221001 60.971001 66.252998 72.057503 77.862 83.143997 86.8395 89.746498 93.442001 97.137497 102.4195 105.3265 110.0765 115.3585 117.9995 123.2815 129.086 131.993 140.43851 145.7205 148.3615 151.0025 156.2845 164.73 167.63699 174.496 179.246 185.05051 190.855 194.55051 200.355 203.26199 209.0665 214.871"
         y="11.5045"
         id="tspan104">Kør ud mod vandet fra vejen mellem Nyborg og </tspan><tspan
         x="0 4.75 9.5 14.782 20.5865 26.391001 32.195499 38 41.695499 47.5 50.140999 53.048 58.330002 60.971001 64.666496 69.948502 75.752998 81.557503 86.307503 91.5895 97.393997 100.301 105.051 108.7465 112.442 117.724 123.5285 129.33299 132.24001 137.522 141.2175 144.1245 149.40649 155.211 158.118 163.9225 166.56351 169.2045 177.64999 181.3455 186.6275 192.43201 198.2365 203.51849 206.42551 210.121 213.8165 217.51199 222.79401 228.5985 234.403"
         y="23.009001"
         id="tspan106">Svendborg. Elsehoved Strand er en glimrende strand </tspan><tspan
         x="0 8.4455004 13.7275 19.532 22.438999 26.134501 28.775499 34.580002 38.275501 41.182499 44.877998 50.16 55.9645 61.769001 64.676003 70.480499 76.285004 79.192001 84.996498 90.801003 94.496498 100.301 105.583 110.333 115.615 121.4195 124.0605 126.7015 132.506 137.78799 140.69501 146.4995 151.2495 157.054 162.85851 168.1405 171.836 174.743 178.43851 183.7205 192.166 195.8615 198.76849 207.214 212.496 216.1915 219.88699 225.16901 228.8645"
         y="34.5135"
         id="tspan108">med fint sand og børnevenlige dybder samt masser </tspan><tspan

         y="46.018002"
         id="tspan110">af liv i sommerhalvåret.</tspan></text>

    <text

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text158"><tspan
         x="0 6.8590002 12.141 17.945499 23.75 29.032 31.938999 35.634499 38.275501 44.080002 49.362 52.269001 55.9645 59.66 63.355499 68.637497 74.442001 80.246498 83.153503 85.794502 88.435501 94.239998 100.0445 105.3265 109.022 111.929 114.57 117.477 123.2815 128.56351 131.72701 134.634 140.43851 146.243 149.14999 153.368 158.118 163.39999 168.68201 171.323 176.605 180.30051 183.996 187.6915 192.9735 198.778 204.5825 207.4895 210.13049 212.7715 218.576 223.858"
         y="0"
         id="tspan138">Denne fine strand ligger i gå- og cykelafstand lige </tspan><tspan
         x="0 5.8045001 9.5 13.1955 16.102501 19.798 25.602501 29.298 32.205002 36.955002 41.705002 46.987 52.7915 58.596001 64.400497 70.205002 73.900497 79.705002 82.346001 85.252998 91.057503 96.3395 102.144 106.894 110.5895 113.4965 118.7785 123.5285 127.224 129.86501 132.772 138.57651 143.85851 149.66299 152.57001 158.3745 163.65649 166.2975 168.93851 171.5795 177.384 182.666 185.573 189.26849 192.964 195.605 198.51199 201.153 206.435 212.2395 218.04401 221.7395"
         y="11.5045"
         id="tspan140">øst for Svendborg. Benyt evt. den dejlige sti langs </tspan><tspan
         x="0 4.75 10.032 15.8365 21.641001 26.923 30.6185 33.525501 37.221001 43.025501 46.721001 52.525501 55.1665 58.073502 61.769001 67.573502 72.855499 75.496498 81.301003 87.105499 92.910004 98.192001 103.9965 106.6375 109.5445 114.2945 117.99 121.6855 126.9675 132.772 138.57651 143.85851 149.66299 152.57001 157.85201 161.5475 164.4545 170.259 176.06351 181.868 187.6725 190.31351 198.759 202.4545 205.3615 211.166 216.9705"
         y="23.009001"
         id="tspan142">vandet forbi roklubben. Stranden er populær og </tspan><tspan
         x="0 3.6954999 6.3365002 8.9775 12.673 16.3685 24.813999 30.096001 35.377998 40.66 44.355499 47.262501 50.958 54.6535 59.935501 62.842499 71.288002 77.092499 80.788002 86.592499 91.874496 97.679001 100.586 104.2815 106.9225 109.5635 112.4705 117.7525 121.448 125.1435 130.42551 136.23 139.13699 144.9415 150.2235 156.028 161.31 164.217 170.0215 175.826 179.5215 185.326 190.608 194.3035 199.58549 208.03101 210.672 213.313 215.95399 221.23599 224.9315"
         y="34.5135"
         id="tspan144">tiltrækker fra morgen til aften både børnefamilier </tspan><tspan
         x="0 5.8045001 11.609 14.516 20.320499 26.125 31.929501 37.211498 39.852501 42.759499 49.6185 55.423 59.1185 61.759499 67.564003 71.259499 76.541496 82.346001 85.252998 90.535004 94.230499 97.137497 101.8875 104.5285 110.333 116.1375 121.942 127.7465 133.0285 136.724 139.36501 142.006 147.8105 150.7175 156.522 162.32651 165.23351 170.5155 176.32001 182.1245 187.40649 190.0475 192.68851 197.9705 201.666 206.948 210.64349"
         y="46.018002"
         id="tspan146">og unge. Udsigten er vidunderlig og appellerer </tspan><tspan
         x="0 3.6954999 6.3365002 8.9775 11.8845 17.688999 20.33 24.548 30.352501 32.9935 37.211498 40.1185 45.923 51.727501 54.634499 60.438999 64.134499 66.775497 69.416496 72.057503 74.698502 77.605499 83.478401 88.760399 94.564903 100.3694 105.6514 109.3469 112.2539 117.5359 121.2314 124.1384 129.9429 135.2249 137.86591 140.5069 143.1479 148.95239 152.6479 155.28889 158.19591 164.0004 169.8049 172.7119 178.5164 183.7984 187.4939 190.40089 195.68291 199.3784 202.2854 207.5674 213.3719"
         y="57.522499"
         id="tspan148">til picnic og grill. Vandet er dejligt, og der er en </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 22.173 27.977501 31.673 37.477501 40.1185 43.025501 48.830002 53.580002 59.384499 63.080002 65.987 71.791496 77.073502 80.768997 83.676003 89.480499 94.762497 98.458 104.2625 112.708 116.4035 121.6855 124.5925 129.3425 134.6245 138.32001 143.60201 147.2975 152.5795 158.384 162.0795 167.3615 170.0025 175.80701 178.714 183.996 190.855 196.13699 198.778 204.5825 209.8645 215.1465"
         y="69.027"
         id="tspan150">badebro, hvor det berømte veteranskib ”Helge” </tspan><tspan
         x="0 2.641 11.0865 16.891001 22.695499 27.977501 31.673 34.580002 38.275501 40.9165 43.557499 46.198502 49.105499 53.855499 57.550999 61.246498 66.528503 72.333 78.137497 83.419502 89.223999 92.130997 94.772003 100.5765 106.381 112.1855 116.9355 122.74 128.022 131.7175 134.6245 138.32001 140.961 143.60201 146.509 152.31351 158.118 160.759 166.56351 170.259 176.06351 178.7045 181.3455 183.9865 186.89349 192.698 197.98 201.67551 204.5825 208.278 210.91901 216.7235 222.528 227.81 231.50549"
         y="80.531502"
         id="tspan152">lægger til. Stranden indbyder til boldspil, der findes </tspan><tspan
         x="0 5.2820001 11.0865 13.9935 22.438999 25.08 30.884501 33.525501 39.330002 45.134499 47.775501 51.471001 57.275501 62.557499 68.362 73.643997 76.551003 82.355499 88.160004 91.067001 93.708 98.989998 104.7945 110.0765 115.881 118.522 123.804 129.60851 133.304 135.94501 138.85201 141.493 144.134 149.93851 155.2205 158.916 164.7205 173.166 176.073 181.355 183.996 189.80051 193.496 198.778 204.06 209.8645 212.7715 218.0535 221.74899"
         y="92.036003"
         id="tspan154">en minigolfbane og legeplads, ligesom kiosken er </tspan><tspan
         x="0 5.8045001 11.0865 14.782 20.5865 29.032 32.727501 35.634499 39.330002 45.134499 48.830002 51.737 60.182499 65.4645 71.268997 76.551003 80.246498 83.153503 86.848999 90.544502 96.348999 100.0445 105.3265 108.2335 111.929 117.7335 121.429 125.1245 127.7655 131.98351 137.2655"
         y="103.5405"
         id="tspan156">berømt for meget store softice.</tspan></text>

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,73.6909,307.3476)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text204"><tspan
         x="0 6.8590002 12.141 15.8365 18.7435 24.025499 27.721001 30.628 35.91 41.7145 44.621498 48.317001 52.012501 57.817001 60.63945 63.280449 66.187447 71.991951 77.273949 79.914948 82.555946 85.196953 91.00145 93.908447 97.603951 101.29945 104.99495 110.27695 116.08145 121.88595 124.52695 127.43395 133.23845 138.52045 142.21594 145.12296 150.92744 153.56845 158.85045 163.60045 166.50745 171.78944 177.59395 180.23495 185.51695 191.32146 195.01695 197.65794 200.56496 206.36945 211.65144"
         y="0"
         id="tspan184">Det er en stor, dejlig strand, der blev anlagt, da </tspan><tspan
         x="0 8.4455004 13.7275 19.532 22.438999 28.2435 32.9935 38.798 44.602501 49.884499 55.688999 60.971001 63.877998 69.863953 75.14595 78.841454 82.536949 88.341454 92.036949 97.841454 103.12345 108.92795 111.83495 117.63945 122.38945 127.67145 131.36694 134.27396 139.02396 142.71945 148.52396 152.21945 157.50145 163.30595 171.75145 174.39246 178.08795 180.72894 183.63596 190.49495 195.77695 199.47244 202.37946 207.66145 211.35695"
         y="11.5045"
         id="tspan186">man byggede Vestbroen over Storebælt. Her er </tspan><tspan
         x="0 8.4455004 13.7275 17.423 21.1185 26.400499 30.096001 33.002998 38.285 41.980499 44.887501 47.5285 55.973999 61.256001 66.538002 71.82 75.515503 79.210999 81.851997 84.759003 88.454498 91.095497 96.900002 100.5955 103.5025 107.198 112.48 118.2845 124.089 126.996 132.80051 138.0825 140.9895 144.685 148.38049 152.076 157.358 163.16251 168.967 174.24899 180.0535 182.96049 188.765 194.5695 197.4765 203.28101 208.563 211.20399 213.845 216.48599 222.2905"
         y="23.009001"
         id="tspan188">masser af lækkert, fint sand på stranden og dejlig </tspan><tspan
         x="0 3.6954999 8.9775 14.782 20.5865 26.391001 32.195499 38 43.804501 46.711498 49.352501 51.9935 57.798 61.4935 64.400497 70.205002 76.009499 81.291496 84.198502 86.8395 89.746498 94.496498 99.778503 105.583 111.3875 116.6695 120.365 123.006 125.913 128.554 131.461 135.15649 140.43851 145.7205 148.3615 151.26849 153.9095 159.1915 164.4735 169.75549 172.66251 176.358 181.64 184.547 187.188 192.47 198.27451 204.07899 207.77451 210.6815 216.48599 222.2905 224.9315"
         y="34.5135"
         id="tspan190">sandbund lidt ude i vandet. I skal ikke så langt ud, </tspan><tspan
         x="0 3.6954999 9.5 13.1955 16.102501 21.907 27.188999 30.884501 33.7915 39.073502 42.769001 45.675999 51.480499 56.230499 62.035 65.730499 68.637497 74.442001 80.246498 85.528503 88.435501 92.130997 94.772003 97.413002 100.32 105.602 111.4065 114.3135 120.118 125.9225 131.72701 134.634 138.3295 143.0795 148.884 157.3295 165.77499 171.05701 174.7525 180.55701 183.3804 186.02139 188.92841 195.7874 201.0694 206.8739 209.7809 213.47639 217.17191 222.97639 226.67191 231.9539"
         y="46.018002"
         id="tspan192">før der er dybt nok til en god svømmetur. Den store </tspan><tspan
         x="0 4.75 10.032 15.8365 21.641001 27.445499 32.727501 38.532001 44.336498 49.6185 58.063999 61.759499 65.455002 69.150497 74.955002 83.400497 89.205002 91.846001 97.650497 103.455 106.362 109.003 111.91 116.66 120.3555 126.16 129.8555 135.1375 140.942 149.3875 152.0285 155.724 158.631 162.32651 168.131 171.82651 177.631 182.91299 186.60851 189.5155 193.211 199.0155 201.8389 204.4799 207.3869 212.6689 216.3644"
         y="57.522499"
         id="tspan194">vandgennemstrømning i Storebælt sørger for, at </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 22.173 26.923 32.205002 38.009499 43.813999 49.096001 52.7915 55.698502 60.980499 63.621498 67.317001 69.958 75.762497 78.669502 83.9515 87.647003 90.554001 94.249496 99.531502 105.336 109.0315 111.9385 117.743 123.5475 126.4545 131.7365 134.3775 139.6595 143.355 147.05051 149.6915 152.5985 159.4575 164.2075 166.8485 170.54401 173.451 176.092 178.99899 181.64 186.922 192.20399 197.48599 200.39301 206.19749 209.89301 215.69749 221.502 226.784 230.47951"
         y="69.027"
         id="tspan196">badevandet altid er rent og klart. Hvis I ikke bruger </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 22.173 25.8685 31.673 34.313999 36.955002 39.862 42.502998 50.948502 56.752998 62.557499 67.8395 71.535004 74.442001 77.083 79.989998 82.630997 87.913002 91.608498 94.515503 100.32 105.602 108.509 114.3135 119.5955 122.5025 127.2525 133.05701 138.339 142.0345 145.73 149.42551 154.7075 157.6145 162.8965 168.1785 173.46049 176.36749 184.813 190.095 193.7905 199.07249 202.76801 205.675 210.957 214.6525"
         y="80.531502"
         id="tspan198">badetøj, lægger I jer på de yderste 150 meter af </tspan><tspan
         x="0 3.6954999 7.3909998 11.0865 16.3685 22.173 27.977501 33.259499 39.063999 41.971001 46.721001 49.627998 55.432499 61.237 64.143997 72.5895 78.393997 84.198502 87.105499 92.910004 96.605499 102.41 107.692 113.4965 116.1375 119.0445 123.7945 127.49 131.1855 136.4675 142.272 148.07651 153.35851 159.16299 162.07001 167.8745 173.15649 176.85201 179.759 182.39999 185.041 189.791 193.4865 198.76849 204.573 210.3775 215.6595 219.355 224.63699 227.278"
         y="92.036003"
         id="tspan200">stranden – ud mod broen. Stranden har livreddere, </tspan><tspan
         x="0 3.6954999 9.5 17.945499 20.852501 24.548 27.188999 32.9935 38.798 44.080002 47.775501 50.682499 53.323502 56.230499 59.925999 65.208 68.903503 74.708 79.989998 85.794502 91.0765 93.983498 99.265503 101.9065 104.5475 107.4545 112.7365 118.0185 121.182 126.464 131.746 134.653 137.29401 140.201 143.8965 149.701 158.1465 166.592 171.87399 175.5695 181.37399 186.65601 190.3515 192.99249 198.797 204.6015 209.8835 215.688"
         y="103.5405"
         id="tspan202">som sidder i tårnene kl. 10-18 i sommerperioden.</tspan></text>

       id="text240"><tspan
         x="0 4.75 8.4455004 12.141 17.423 23.227501 29.032 34.313999 40.1185 43.025501 45.6665 48.307499 54.112 59.9165 65.198502 68.893997 71.801003 74.442001 77.348999 81.044502 86.848999 90.544502 96.348999 98.989998 104.7945 110.599 115.881 118.522 122.2175 127.4995 130.40649 138.85201 144.134 149.93851 152.8455 158.64999 164.4545 167.0955 172.89999 178.18201 183.9865 186.89349 191.64349 195.339 199.0345 204.3165 210.121 215.92551"
         y="0"
         id="tspan230">Stranden ligger i forbindelse med Bøjden Strand </tspan><tspan
         x="0 4.75 10.032 13.7275 16.3685 21.650499 27.455 32.737 36.432499 41.7145 44.355499 47.262501 54.121498 59.4035 63.098999 66.005997 71.288002 74.983498 77.890503 83.172501 88.976997 91.884003 95.579498 104.025 109.8295 115.1115 117.7525 120.6595 126.464 131.214 133.855 139.6595 142.5665 146.26199 151.54401 157.3485 163.153 166.8485 170.54401 174.2395 179.5215 185.326 191.13049 193.7715 196.6785 202.483 207.233 213.03751 216.733"
         y="11.5045"
         id="tspan232">Feriepark. Det er en smuk, hvid sandstrand, hvor </tspan><tspan
         x="0 8.4455004 13.7275 19.532 22.438999 26.134501 31.4165 36.698502 39.3395 42.246498 45.942001 48.583 54.387501 58.083 60.723999 66.528503 69.435501 72.0765 77.358498 83.163002 88.967499 92.663002 95.57 101.3745 107.179 109.82 112.727 115.368 121.1725 126.977 132.259 138.06351 140.9705 146.77499 152.05701 155.7525 158.6595 164.464 167.105 169.746 174.496 179.778 183.4735 186.38049 192.185 196.935 202.7395 206.435 209.076 211.983 217.265 223.0695"
         y="23.009001"
         id="tspan234">man skal rigtig langt ud, inden det bliver dybt. En </tspan><tspan
         x="0 5.8045001 11.609 17.4135 23.218 25.858999 34.304501 38 40.907001 46.711498 52.515999 55.423 59.1185 61.759499 67.564003 71.259499 73.900497 79.705002 82.612 88.416496 94.221001 97.916496 103.721 109.003 113.753 119.035 124.8395 127.4805 130.12151 135.92599 138.83299 142.5285 146.224 149.91949 155.20151 161.006 166.8105 169.7175 175.522 180.804 183.711 189.5155 194.7975 198.493 201.39999 205.0955 209.8455 215.64999 218.291 220.93201 226.7365 232.01849"
         y="34.5135"
         id="tspan236">populær og rigtig børnevenlig strand på det sydlige </tspan><tspan
         x="0 4.75 9.5 15.3045"
         y="46.018002"
         id="tspan238">Fyn.</tspan></text>

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,340.1476,711.5838)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text284"><tspan
         x="0 5.2820001 11.0865 13.9935 19.275499 22.971001 25.878 30.628 35.377998 41.182499 44.877998 47.785 53.5895 58.871498 64.676003 68.371498 72.067001 77.348999 80.255997 86.060501 91.864998 94.772003 103.2175 108.4995 112.195 115.8905 118.7975 124.602 130.40649 136.211 142.0155 144.65649 153.10201 156.7975 162.0795 164.9865 170.791 176.073 181.8775 187.1595 190.855 194.55051 198.246 203.528 209.3325 215.13699 220.41901 223.06"
         y="0"
         id="tspan266">En af Fyns bedste og mest populære badestrande. </tspan><tspan
         x="0 6.8590002 12.141 17.945499 20.852501 24.548 28.2435 31.938999 40.384499 45.6665 50.948502 56.230499 59.925999 62.833 66.528503 69.169502 74.973999 77.880997 81.5765 84.217499 89.499496 93.195 98.476997 101.384 106.666 109.307 111.948 117.7525 126.198 131.48 135.17551 140.4575 144.153 147.06 150.75549 154.451 159.733 162.64 167.922 173.7265 179.0085 184.813 193.2585 196.95399 202.7585 208.563 214.36749 219.64951"
         y="11.5045"
         id="tspan268">Den strækker sig flere kilometer fra Enebærodde </tspan><tspan
         x="0 3.6954999 6.3365002 8.9775 11.8845 17.688999 22.971001 26.6665 32.471001 37.752998 41.448502 47.252998 50.16 55.9645 61.769001 64.676003 69.958 75.762497 79.458 83.153503 88.435501 92.130997 97.935501 100.8425 105.5925 109.288 112.9835 118.2655 124.07 129.8745 132.5155 135.4225 142.28149 147.56351 151.259 154.166 159.448 163.14349 166.05051 168.6915 173.9735 178.7235 182.41901 185.326 191.13049 196.935"
         y="23.009001"
         id="tspan270">til Bårdesø og Tørresø Strand. Her er lavt og </tspan><tspan
         x="0 5.8045001 11.609 15.3045 21.108999 26.391001 31.141001 36.423 42.227501 44.8685 47.509499 53.313999 57.009499 59.9165 64.666496 69.948502 75.752998 81.557503 84.198502 87.105499 92.387497 96.083 98.989998 101.631 106.913 112.7175 118.522 122.2175 125.1245 130.929 133.57001 139.3745 144.65649 147.56351 151.259 157.06351 159.7045 165.509 170.791 174.4865 177.39349 181.089 184.7845 188.48 193.76199 199.5665 205.371 210.653 216.4575 219.3645 225.16901 230.9735"
         y="34.5135"
         id="tspan272">børnevenligt vand. Et langt dige følger stranden og </tspan><tspan
         x="0 5.2820001 8.9775 11.8845 17.1665 22.971001 25.878 31.682501 37.487 40.127998 45.41 51.2145 54.91 57.817001 66.262497 72.067001 74.708 77.348999 83.153503 88.958 94.239998 100.0445 102.9515 106.647 112.4515 116.147 119.054 124.336 130.1405 133.0475 138.85201 144.134 147.8295 153.634 156.45645 159.09744 162.00446 167.80894 173.09094 181.53645 187.34094 189.98195 195.78645 201.59094 207.39545 210.03645 215.31845 221.12296 224.81845 230.10045 235.90495"
         y="46.018002"
         id="tspan274">er en oplagt mulighed for en gåtur. Campingpladsen </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 21.641001 26.923 32.727501 35.634499 40.9165 44.612 47.519001 53.323502 59.127998 62.823502 68.105499 71.012497 79.458 84.739998 90.544502 95.8265 99.522003 102.429 108.2335 114.038 119.8425 125.647 128.28799 136.73351 139.5569 142.19791 145.1049 154.07291 159.3549 165.15939 168.06641 173.8709 179.15289 182.8484 185.7554 191.55991 196.8419"
         y="57.522499"
         id="tspan276">bagved er også meget populær. Men pas på </tspan><tspan
         x="0 3.6954999 7.3909998 11.0865 16.891001 25.3365 33.782001 39.063999 44.8685 47.509499 50.4165 54.112 59.9165 63.612 66.518997 72.323502 77.605499 81.301003 84.208 89.489998 93.185501 96.092499 99.788002 105.07 108.7655 112.461 115.368 121.1725 126.4545 129.3615 134.1115 139.39349 145.198 151.0025 156.2845 159.98 162.88699 168.6915 173.9735 176.88049 183.7395 189.54401 193.2395 199.04401 202.7395 207.4895 213.29401 215.935"
         y="69.027"
         id="tspan278">strømmen, for der er fart på vandet på Nordfyn, </tspan><tspan
         x="0 5.8045001 10.5545 13.1955 15.8365 21.1185 26.400499 30.096001 33.002998 38.807499 41.448502 46.198502 51.480499 55.175999 58.083 63.887501 69.692001 75.496498 80.778503 83.685501 89.489998 95.294502 97.935501 103.74 109.022 112.7175 115.6245 121.429 127.2335 130.1405 133.836 137.53149 140.1725 143.868 149.14999 152.05701 156.80701 162.089 167.89349 173.698 176.339 179.246 187.6915 192.9735 198.778 201.685 207.4895 213.29401 216.9895 222.2715"
         y="80.531502"
         id="tspan280">hvilket giver gode bølger og frisk vand, men også </tspan><tspan
         x="0 5.8045001 11.0865 16.891001 22.695499 27.445499 30.352501 34.048 39.852501 43.548 46.455002 52.259499 60.705002 64.400497 69.682503 75.487 80.768997 86.051003 88.692001 91.598999 97.403503 102.6855 106.381 109.288 117.7335 123.0155 128.82001 131.72701 137.53149 142.81351 148.618 153.89999 156.7234"
         y="92.036003"
         id="tspan282">behov for omtanke, når man bader.</tspan></text>

    <text
       xml:space="preserve"

         y="0"
         id="tspan306">i Bogense på Nordfyn</tspan></text>
    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,340.1476,544.3397)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text332"><tspan
         x="0 5.8045001 11.609 17.4135 22.695499 28.5 32.195499 37.477501 40.384499 46.188999 50.938999 53.846001 59.127998 62.823502 65.730499 71.012497 73.653503 77.348999 79.989998 85.794502 88.7015 93.983498 97.679001 100.586 106.3905 111.6725 115.368 121.1725 126.977 129.884 134.634 143.0795 146.77499 152.5795 155.2205 158.1275 163.93201 169.214 172.9095 175.8165 179.51199 185.3165 193.76199 202.2075 207.4895 211.185 216.467 222.2715 225.1785 230.46049 234.15601"
         y="0"
         id="tspan310">Bogense by er altid et besøg værd, når sommeren er </tspan><tspan
         x="0 5.8045001 11.0865 13.9935 17.688999 20.33 24.025499 26.932501 32.737 38.5415 41.182499 46.4645 50.16 53.855499 59.137501 61.7785 64.685501 70.489998 76.294502 79.2015 81.842499 84.749496 88.445 92.140503 100.586 106.3905 112.195 117.477 121.1725 124.0795 127.775 130.416 133.05701 135.964 141.246 147.05051 149.9575 155.76199 161.04401 166.8485 172.13049 175.826 181.63049 184.4539 187.09489 190.00191 198.96989 204.25191 210.0564 212.96339 218.24541 223.5274 229.33189"
         y="11.5045"
         id="tspan312">på sit højeste, og I trænger til en badetur. Man kan </tspan><tspan
         x="0 5.2820001 11.0865 14.782 20.063999 25.8685 28.775499 33.525501 41.971001 44.612 50.4165 55.698502 58.605499 64.410004 69.692001 75.496498 80.778503 84.473999 88.169502 91.864998 97.147003 102.9515 108.756 114.038 119.8425 122.7495 126.445 129.086 131.72701 134.634 139.384 144.666 150.4705 154.166 157.8615 161.55701 166.839 169.746 173.4415 179.246 182.9415 185.8485 194.29401 199.576 203.2715 205.91251 211.717 216.99899 222.28101 228.08549 230.7265"
         y="23.009001"
         id="tspan314">enten vælge badestranden til venstre for marinaen, </tspan><tspan
         x="0 5.2820001 7.9229999 10.564 15.846 19.5415 22.4485 30.893999 36.175999 41.980499 44.887501 50.169498 55.4515 61.256001 64.163002 69.967499 75.249496 78.156502 80.797501 86.079498 91.884003 97.688499 101.384 104.291 110.0955 115.3775 121.182 124.089 129.89349 134.64349 139.92551 142.8325 148.63699 153.91901 158.66901 164.4735 169.75549 173.451 177.1465 182.951 188.75549 192.451 195.358 201.16251 206.967 209.87399 215.15601 220.96049 226.765 232.047"
         y="34.5135"
         id="tspan316">eller man kan gå langs den nye havnefront og ende </tspan><tspan
         x="0 4.75 10.032 15.8365 18.7435 22.438999 28.2435 34.048 39.330002 45.134499 50.4165 54.112 56.752998 59.66 66.518997 71.801003 75.496498 78.403503 82.098999 84.739998 90.544502 96.348999 101.631 105.3265 108.2335 111.929 114.57 119.32 125.1245 130.40649 136.211 139.90649 145.711 150.993 154.68851 157.5955 163.39999 169.2045 172.1115 175.80701 181.6115 190.05701 198.5025 203.7845 207.48 211.17551 213.8165 219.0985 224.903 230.185 233.00841 235.6494"
         y="46.018002"
         id="tspan318">ved søbadet. Her findes flydebroer og tømmerflåder, </tspan><tspan
         x="0 3.6954999 9.5 17.945499 20.852501 23.4935 26.400499 31.682501 36.9645 42.769001 45.675999 49.371498 55.175999 58.871498 61.512501 66.262497 69.958 73.653503 78.935501 81.842499 84.483498 89.765503 93.460999 96.367996 104.8135 110.0955 115.9 118.541 121.448 126.198 132.0025 137.80701 143.089 148.89349 154.17551 157.871 160.778 166.5825 171.8645 177.66901 182.41901 187.701 193.50549 199.31 204.592 208.28751 211.1945 214.89 217.53101 223.33549"
         y="57.522499"
         id="tspan320">som I kan forlyste jer med. Søbadet henvender sig </tspan><tspan
         x="0 3.6954999 6.3365002 8.9775 11.8845 17.688999 22.971001 26.6665 29.5735 32.2145 34.855499 40.66 44.355499 47.262501 55.708 58.348999 64.153503 67.848999 73.130997 76.038002 81.842499 87.647003 93.4515 96.092499 98.733498 104.0155 109.82 118.2655 120.9065 123.8135 132.259 137.541 143.3455 146.2525 149.948 155.23 161.0345 166.3165 170.01199 175.29401 178.201 184.00549 189.28751 192.1945 197.4765 201.172 204.86749 210.14951 215.95399 221.23599 227.0405"
         y="69.027"
         id="tspan322">til det lidt ældre publikum, men senere på aftenen </tspan><tspan
         x="0 5.2820001 8.9775 11.8845 17.688999 22.971001 26.6665 29.5735 35.377998 39.073502 42.769001 48.050999 50.958 59.4035 64.685501 70.489998 76.294502 81.5765 84.483498 90.288002 96.092499 101.897 107.179 110.086 118.5315 123.8135 129.618 135.4225 140.7045 144.39999 149.68201 154.964 158.6595 161.5665 164.2075 167.1145 172.91901 178.7235 181.63049 187.435 195.88049 201.16251 204.858 207.49899 213.3035 219.108"
         y="80.531502"
         id="tspan324">er der ofte mange unge mennesker i og omkring </tspan><tspan
         x="0 3.6954999 9.5 15.3045 20.5865 26.391001 31.673 35.3685 38.009499 40.9165 46.198502 51.480499 54.387501 58.083 61.7785 65.473999 70.755997 76.560501 82.364998 87.647003 93.4515 96.358498 101.1085 106.3905 112.195 115.102 123.5475 128.8295 132.52499 135.166 140.9705 146.2525 151.5345 157.339 160.246 165.528 169.2235 172.13049 177.935 183.217 186.91251 189.8195 195.62399 201.4285 207.233 212.515"
         y="92.036003"
         id="tspan326">søbadet. På stranden ved marinaen er der gode </tspan><tspan
         x="0 8.4455004 14.25 16.891001 19.532 25.3365 31.141001 36.423 42.227501 47.509499 51.205002 54.112 57.807499 63.612 67.307503 70.2145 76.018997 81.823502 85.518997 91.323502 96.605499 100.301 105.583 114.0285 116.6695 119.3105 121.9515 127.2335 130.0569 132.69791 135.6049 142.4639 147.7459 151.44141 154.3484 159.6304 163.3259 166.23289 172.0374 177.3194 181.01489 183.92191 187.6174 193.42191 197.1174 202.92191 208.72639 211.3674 217.17191 220.8674 225.6174 228.25841 231.9539"
         y="103.5405"
         id="tspan328">muligheder for børnefamilier. Her er der forholdsvis </tspan><tspan
         x="0 2.641 7.9229999 12.673 17.423 22.705 28.509501 34.313999 39.596001 43.2915 46.198502 52.002998 57.285 60.192001 64.942001 70.223999 76.028503 79.723999 83.419502 87.114998 92.397003 95.304001 98.999496 101.6405 107.445 112.727 115.634 120.916 124.6115 127.5185 131.214 134.9095 140.1915 145.996 151.80051 154.4415 160.246 165.528 169.2235 175.028 180.31"
         y="115.045"
         id="tspan330">lavvandet på venstre side af stendigerne.</tspan></text>

    <text

       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text372"><tspan
         x="0 5.2820001 10.564 13.471 18.221001 23.503 29.307501 35.112 40.394001 43.035 48.317001 54.121498 59.925999 62.833 65.473999 68.114998 73.919502 79.723999 85.005997 88.7015 91.608498 97.413002 102.695 108.4995 111.4065 117.211 122.493 126.1885 131.993 140.43851 144.134 149.416 152.323 158.1275 160.76849 164.464 168.1595 170.80051 176.605 182.4095 187.6915 190.5985 195.3485 199.04401 202.7395 208.0215 213.826 219.63049 222.2715"
         y="0"
         id="tspan358">På Langeland ligger den berømte Ristinge Strand, </tspan><tspan
         x="0 3.6954999 9.5 17.945499 20.852501 26.657 31.938999 34.580002 38.275501 41.182499 46.987 49.627998 54.377998 59.66 63.355499 66.262497 71.544502 75.239998 78.147003 83.429001 89.233498 92.140503 97.422501 101.118 104.025 109.8295 115.1115 118.0185 123.823 129.105 134.9095 138.605 142.30051 147.5825 150.4895 156.29401 161.576 167.38049 172.66251 176.358 180.0535 183.74899 189.03101 194.83549 200.64 205.922 208.82899 214.6335 219.9155"
         y="11.5045"
         id="tspan360">som helt givet er en af de bedste badestrande på </tspan><tspan
         x="0 4.75 9.5 15.3045 17.945499 20.852501 26.657 31.938999 35.634499 41.438999 49.884499 53.580002 56.487 62.2915 64.932503 67.573502 72.855499 75.496498 78.403503 82.098999 87.903503 91.598999 94.505997 98.2015 100.8425 106.647 109.554 113.2495 115.8905 121.695 125.3905 129.086 134.368 137.27499 143.0795 148.3615 152.05701 157.8615 161.55701 164.464 172.9095 178.1915 183.996 186.903 192.185 197.467 200.37399 208.8195 214.1015 217.797 223.07899 226.77451"
         y="23.009001"
         id="tspan362">Fyn. Berømt bl.a. for sin flotte natur med 30 meter </tspan><tspan
         x="0 5.8045001 11.609 14.25 19.532 22.438999 27.721001 30.362 33.002998 38.807499 42.502998 47.785 51.480499 54.387501 60.192001 65.996498 68.903503 74.708 79.989998 83.685501 89.489998 95.294502 100.5765 106.381 109.288 114.57 118.2655 121.1725 125.9225 131.2045 133.8455 139.1275 144.93201 150.7365 156.01849 159.714 162.621 166.3165 170.01199 175.29401 181.0985 184.00549 189.28751 192.983 195.89 201.172 203.813 209.61749 215.422 220.70399"
         y="34.5135"
         id="tspan364">høje klinter og desuden et velegnet sted at kigge </tspan><tspan
         x="0 5.2820001 8.9775 12.673 17.955 21.650499 24.557501 28.253 34.057499 37.752998 41.448502 44.0895 46.730499 52.012501 54.835899 57.476898 60.3839 66.720398 72.524902 80.970398 86.774902 89.415901 95.220398 100.5024 104.1979 107.1049 112.9094 118.1914 123.9959 129.27789 132.9734 138.77789 142.4734 147.7554 153.55991 156.4669 164.9124 170.1944 175.9989 178.9059 184.1879 189.9924 192.8994 198.1814 203.9859 209.79041 215.0724 220.87691"
         y="46.018002"
         id="tspan366">efter fossiler. Kombiner badeturen med en anden </tspan><tspan
         x="0 5.8045001 11.0865 14.782 20.5865 24.282 30.0865 35.890999 38.532001 43.813999 48.563999 53.846001 56.487 60.182499 65.4645 68.105499 71.012497 74.708 79.989998 82.897003 86.592499 92.397003 100.8425 106.647 112.4515 117.7335 123.538 129.3425 134.6245 137.53149 141.22701 144.9225 150.2045 156.009 158.916 164.198 169.48 175.2845 178.1915 183.4735 189.278 197.7235 206.16901 211.451 214.358 220.16251 222.8035 228.08549 236.53101"
         y="57.522499"
         id="tspan368">naturoplevelse, så spændende sten kan komme hjem </tspan><tspan
         x="0 3.6954999 6.3365002 8.9775 11.8845 15.58 20.862 29.307501 31.9485 34.5895 40.394001 46.198502 51.480499 57.285 60.192001 65.473999 68.114998 70.755997 76.038002 79.733498 82.640503 88.445 91.085999 96.890503 100.586 103.493 109.2975 114.5795 120.384 126.1885 131.993 135.68851 140.9705 144.666 147.573 150.214 153.121 158.92551 161.5665 164.2075 169.4895 175.29401 178.201 184.00549 189.28751 192.1945 196.9445 202.2265 204.86749 207.77451 213.57899 216.22 221.502 229.94749"
         y="69.027"
         id="tspan370">til samlingen eller blot beundres i bilen på vej hjem.</tspan></text>

    <text
       xml:space="preserve"
       transform="matrix(1,0,0,-1,340.1476,200.7413)"
       style="font-variant:normal;font-weight:normal;font-stretch:normal;font-size:9.5px;font-family:'Frutiger 55 Roman';-inkscape-font-specification:Frutiger-Roman;writing-mode:lr-tb;fill:#231f20;fill-opacity:1;fill-rule:nonzero;stroke:none"
       id="text418"><tspan
         x="0 6.8590002 12.141 15.8365 18.7435 24.025499 27.721001 30.628 36.432499 42.237 48.0415 53.323502 57.019001 59.925999 63.621498 69.426003 73.121498 76.028503 81.310501 83.9515 86.592499 91.874496 94.781502 100.0635 102.7045 108.509 112.2045 117.4865 120.3935 126.198 131.48 135.17551 137.8165 140.7235 144.41901 147.06 152.8645 158.66901 162.3645 168.16901 170.81 173.451 176.092 178.99899 184.8035 190.608 196.41251 202.217 207.49899 213.3035 219.108 224.91251 230.1945 232.83549"
         y="0"
         id="tspan398">Der er noget for alle aldre her: ringspil, hoppepude, </tspan><tspan
         x="0 2.641 7.9229999 13.7275 19.009501 24.813999 30.6185 34.313999 40.1185 42.759499 45.6665 50.948502 53.5895 58.871498 62.567001 66.262497 71.544502 75.239998 80.522003 86.3265 88.967499 91.874496 95.57 100.852 106.6565 112.461 117.743 123.025 126.7205 130.416 135.698 138.605 147.05051 152.3325 158.13699 161.04401 166.8485 170.54401 175.826 180.576 185.858 191.66251 194.3035"
         y="11.5045"
         id="tspan400">legeborg, klatrereb, sandkasse med gravko, </tspan><tspan
         x="0 5.8045001 11.0865 14.782 20.063999 25.8685 31.673 37.477501 42.759499 45.400501 48.307499 52.002998 55.698502 60.980499 66.785004 72.5895 76.285004 81.567001 87.371498 93.176003 95.817001 99.512497 102.4195 108.224 114.0285 116.9355 119.5765 124.8585 130.1405 135.4225 138.3295 146.77499 149.416 155.2205 161.02499 164.7205 168.416 171.323 176.605 182.4095 185.3165 191.121 199.5665 203.26199 211.7075 216.9895 220.685 224.38049"
         y="23.009001"
         id="tspan402">petanque, stangtennis og ikke mindst en nærmest </tspan><tspan
         x="0 2.641 7.9229999 13.7275 19.009501 24.813999 30.6185 35.900501 39.596001 42.237 45.932499 51.2145 54.121498 62.567001 65.208 71.012497 73.653503 79.458 85.262497 87.903503 91.598999 97.403503 102.6855 108.49 113.772 117.4675 120.3745 127.2335 132.5155 136.211 142.0155 147.82001 153.6245 158.3745 163.65649 167.35201 170.259 175.541 179.2365 182.14349 187.948 193.23 196.92551 199.8325 205.1145 210.91901"
         y="34.5135"
         id="tspan404">legendarisk minigolfbane! Derudover er der en </tspan><tspan
         x="0 5.2820001 13.7275 22.173 27.977501 33.259499 36.1665 41.971001 45.6665 54.112 57.807499 63.612 66.252998 74.698502 80.502998 85.785004 88.692001 94.496498 100.301 103.208 108.49 114.2945 117.2015 119.8425 128.28799 133.57001 138.85201 144.134 147.8295 150.7365 154.43201 159.714 165.51849 171.323 175.01849 178.714 182.4095 187.6915 193.496 199.30051 201.9415 204.8485 211.7075 216.9895 220.685 223.592 228.87399 232.5695"
         y="46.018002"
         id="tspan406">kæmpe græsplæne og en lækker sandstrand. Der er </tspan><tspan
         x="0 5.8045001 11.609 15.3045 20.5865 25.8685 28.509501 31.4165 39.862 45.144001 50.948502 53.855499 59.137501 64.419502 70.223999 73.130997 75.772003 78.413002 84.217499 90.022003 95.304001 98.210999 100.852 103.759 106.4 114.8455 117.7525 123.0345 126.73 129.371 132.278 138.0825 143.88699 146.79401 155.2395 160.5215 166.326 169.233 174.515 179.797 185.6015 188.5085 194.313 199.595 203.2905 208.57249 213.85451 217.55 222.832"
         y="57.522499"
         id="tspan408">buske, man kan ligge i læ af, og man kan parkere </tspan><tspan
         x="0 2.641 5.5479999 9.2434998 14.5255 20.33 25.08 30.362 36.1665 38.807499 41.7145 45.41 50.692001 53.598999 62.044498 67.3265 73.130997 76.038002 78.679001 83.960999 89.242996 94.525002 97.431999 102.714 108.5185 116.964 125.4095 130.6915 134.38699 137.29401 143.0985 148.38049 154.185 157.092 160.78751 163.4285 166.0695 168.9765 174.2585 180.063 182.97 186.6655 190.36099 195.64301 201.44749 206.72951 212.534 218.3385 223.6205"
         y="69.027"
         id="tspan410">i skoven, så man ikke kommer hen til en stegende </tspan><tspan

         y="80.531502"
         id="tspan412">hed bil efter endt strandtur. </tspan><tspan
         x="0 4.75 7.3909998 15.8365 21.641001 26.923 29.563999 33.259499 39.063999 44.346001 50.150501 53.057499 59.9165 65.198502 71.002998 79.448502 84.730499 88.426003 93.708 97.403503 100.3105 102.9515 111.397 116.679 120.3745 125.6565 129.35201 133.0475 138.3295 141.2365 144.93201 148.6275 152.323 157.605 163.4095 169.214 172.121 175.8165 181.621 185.3165 188.2235 194.028 199.8325 203.528 209.3325 212.2395 218.04401 223.8485"
         y="92.036003"
         id="tspan414">Simpelthen Danmarks lækreste strand for børn og </tspan><tspan
